import logo from '../../assets/logo.svg';

import { Container, Content, Background } from './styles';

export const SignIn = () => {
  return (
    <Container>
      <Content>
        <img src={logo} alt="Skatista" />
      </Content>

      <Background />
    </Container>
  );
};
